void reconstructFormattingElements() {
Element last = lastFormattingElement();
if (last == null || onStack(last))
return;
}

Tag reset() {
super.reset();
attributes = new Attributes();
return this;
}

private boolean anythingElse(Token t, HtmlTreeBuilder tb) {
tb.insertStartTag("html");
tb.transition(BeforeHead);
return tb.process(t);
}

private boolean handleMissingTr(Token t, TreeBuilder tb) {
boolean processed = tb.processEndTag("tr");
if (processed)
return tb.process(t);
}

public Element(Tag tag, String baseUri, Attributes attributes) {
super(baseUri, attributes);
Validate.notNull(tag);
this.tag = tag;
}

char consume() {
char val = pos >= length ? EOF : input[pos];
pos++;
return val;
}

boolean matchesLetter() {
if (isEmpty())
char c = input[pos];
return (c >= 'A' && c <= 'Z') || (c >= 'a' && c <= 'z');
}

public static Document parse(String html, String baseUri) {
TreeBuilder treeBuilder = new HtmlTreeBuilder();
return treeBuilder.parse(html, baseUri, ParseErrorList.noTracking());
}

EndTag() {
super();
type = TokenType.EndTag;
}

ParseErrorList(int initialCapacity, int maxSize) {
super(initialCapacity);
this.maxSize = maxSize;
}

public Document(String baseUri) {
super(Tag.valueOf("#root"), baseUri);
this.location = baseUri;
}

protected abstract boolean process(Token token);
if (currentToken == start) { // don't recycle an in-use token
return process(start.reset().name(name));
}

protected Element currentElement() {
int size = stack.size();
return size > 0 ? stack.get(size-1) : null;
}

protected boolean process(Token token) {
currentToken = token;
return this.state.process(token, this);
}

boolean process(Token token, HtmlTreeBuilderState state) {
currentToken = token;
return state.process(token, this);
}

void insert(Element el) {
insertNode(el);
stack.add(el);
}

Element pop() {
int size = stack.size();
return stack.remove(size-1);
}

private boolean inSpecificScope(String targetName, String[] baseTypes, String[] extraTypes) {
specificScopeTarget[0] = targetName;
return inSpecificScope(specificScopeTarget, baseTypes, extraTypes);
}

boolean isSpecial(Element el) {
String name = el.nodeName();
return StringUtil.in(name, TagSearchSpecial);
}

abstract Token reset();
if (sb != null) {
sb.delete(0, sb.length());
}
